  return (
    // const myRecipesList= `` aici pun linku de fetch ca sa imi aduca retetele introduse de acelsi id de user
    //apoi fac fetch aici

    <div className='my-account'>
      <h2>My Account</h2>

      <h3>My Recipes</h3>
      <ul className="my-recipe-list">
          {/* aici o sa mapez retetele userului sub forma de li */}
          {/* va duce spre pagina retetei aleia */}
          {/* poate pot sa fac pur si simplu cu <a/> catre o pagina cu reteta aia dupa id-ul retetei */}
          {/* {myRecipesList.map((myRecipe) => <MyRecipes name={myRecipeList}/>)} */}
        </ul>

        <button id='add-btn'><a href="../add-from">Add Recipe</a></button>
    </div>
  )
}
